import React, {useState} from 'react';
import Grid from '@mui/material/Unstable_Grid2/Grid2';
import ValueChanger from './ValueChanger';
import ChannelChanger from './ChannelChanger.js';
function ScopeChanger(props){
    console.log(props.value);
    const sendChange = (newValue) => {
        props.onValueChange(newValue);
    }
    const properties = props.value['1'];
    const activeChannels =properties['activeChannels'];
    const newKeyHistory = [...props.keyHistory, '1'];//CHANGE ONE
    let channels = [];
    for(let channelIndex = 1; channelIndex <= 8; channelIndex++){
        if(activeChannels.includes(channelIndex)){
            channels.push(
                <Grid key={channelIndex} md={4}>
                    <ChannelChanger value={properties['channelsConfigSettings'][channelIndex]} channelNumber={channelIndex} isActive={true} keyHistory={[...newKeyHistory, 'channelsConfigSettings', channelIndex]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ChannelChanger>
                </Grid>   
            )    
        }
        else{
            channels.push(
                <Grid key={channelIndex} md={4}>
                    <ChannelChanger value={''} channelNumber={channelIndex} isActive={false} keyHistory={[...newKeyHistory, 'channelsConfigSettings', channelIndex]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ChannelChanger>
                </Grid>   
            )    
        }
        
    }
    console.log(activeChannels);
    return(
        <Grid container columns={16} spacing={1} sx={{px: 1}}>
            {/* ROW 1 */}
            <Grid md={3}>
                <ValueChanger property={'connectionString'} value={properties['connectionString']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={3}>
                <ValueChanger property={'waveFormat'} value={properties['waveFormat']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={4}>
                <ValueChanger property={'name'} value={properties['name']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={3}>
                <ValueChanger property={'filePath'} value={properties['filePath']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={3}>
                <ValueChanger property={'fileFormat'} value={properties['fileFormat']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            {/* ROW 1 */}
            {/* ROW 2 */}
            <Grid md={2}>
                <ValueChanger property={'type'} value={properties['type']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'triggerType'} value={properties['triggerType']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'memSize'} value={properties['memSize']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'tdiv'} value={properties['tdiv']} keyHistory={newKeyHistory}propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'samplingRate'} value={properties['samplingRate']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'timeOffset'} value={properties['timeOffset']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'triggerLevel'} value={properties['triggerLevel']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'triggerDelay'} value={properties['triggerDelay']} keyHistory={newKeyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            {/* ROW 2 */}

            {/* ROW 3 */}
            {channels}
            {/* ROW 3 */}



















        </Grid>
    )
}

export default ScopeChanger;
